db.getCollection("article").insert([ {
    _id: ObjectId("622ca7aefa16aa47ca17d6ff"),
    articleRid: NumberLong("1"),
    title: "动人的微笑",
    articleType: NumberInt("10001"),
    tags: [
        "记叙文",
        "七年级",
        "676字"
    ],
    text: "      以前，我是一个脆弱的人，经不起一点儿的困难与挫折。但是从那一幕之后，我变了，变得自信与坚强，我不会忘记，是那拨动心弦的微笑给了我无限的勇气。\n    那是一次竞赛失利后，我很难过。放学了，同学们都陆续地离开了，唯有我独自一人，坐在那空旷无人的操场上。校园在夕阳的映衬下显得格外凝重。树上的知了依旧不知疲倦地鸣叫，仿佛和我一样，烦闷、忧郁。\n    突然间，我看到了校园里那棵广玉兰。她在夕阳的映照下，分外孤寂。但她依然昂然挺\n立在那儿，任寒风吹拂她干燥的面颊，任暴雨击打她疲惫的身躯。她，是那么坚强；她，是那么勇敢；她，是那么倔强；她，是那么执著！\n    想着想着，突然发现，广玉兰树下出现了一个美丽的身影。她就是我的语文老师，她微笑着，仿佛是正在盛开的广玉兰花，如此纯洁，如此美丽。她朝我走来，牵起我，一直到广玉兰的树下，我们一同坐着广玉兰花下，细心体会着这顽强的生命。她，依旧微笑着。只是，那微笑好似三月的春风轻拂我的脸颊，好似六月的细雨滋润我干涸的内心，好似母亲的疼爱亲吻。她什么也没说，只是一直微笑着，微笑着……\n    顿时，我恍然大悟，这慧心的微笑是想让我明白，微笑是使广玉兰经历风雨，但依然屹\n立不倒的原因；是使广玉兰虽无生机，但仍用微笑承受着一切。\n    “黑暗过后是黎明，寒冬过后是阳春”。我终于明白，经历风雨，遭受挫折是迎接微笑的前提。她，用动人心弦的微笑告诉我：“失败是为下一次的成功奠定基础。”从那拨动心弦的微笑中，我感悟到了生命的意义。\n    此后，无论遇到任何事，我都坚强地面对。即使想放弃的时候，想想广玉兰树下那拨动心弦的微笑，我就会抬起头，告诉自己，不能认输。\n    那微笑好美，好美！",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626ba3d02071103c96486c4c"),
    articleRid: NumberLong("2"),
    title: "传递历史的清音",
    articleType: NumberInt("10002"),
    tags: [
        "议论文",
        "九年级",
        "1000字"
    ],
    text: "历史的长河不息，永远传递着千古帝王的悲哀。\n                                                  ——题记\n    滚滚长江，掀起了滔天巨浪。那是历史的怒吼，是帝王家族无限的惆怅。它的每一次翻滚，都卷起一场不平凡的命运。历史的清音，携着帝王们的血泪，永恒地传递下去。\n    奏响悠扬的清音，延伸到凄凉的远古。\n荒淫，泯灭人性的乐趣\n    酒池肉林中，落花沾染着多少无辜生命的鲜血。\n    为了博红颜一笑，他甘心让自己的灵魂堕入了地狱。商纣王，一个用残暴诠释爱怜的人，他的爱，造就了无数的冤魂。上天赋予了他至高无上的权利，无人能比的才能，可他却用了一个错误的方式去回馈上苍。他的爱，害了他的臣民，同时也将一切的罪过推向了他爱的人。沧桑的历史中，妲己——红颜祸水成了不可分割的两个词。虿盆里，是怨灵们的哭诉；炮烙柱下，是厉鬼们的怒号。泱泱大商，被这个曾经的天人，拖到了历史的底层。\n    历史的清音，氤氲着血与泪的见证。\n    跨越千年的长河，这清音，传递到了另一个悲剧中。\n无奈，沦为傀儡的命运\n    幽幽汉宫中，清风吹不散束缚于身的枷锁。\n    西汉初年，一个群雄割据的年代。自汉高祖刘邦逝世，大汉政权被太后吕雉收人囊中，各分封国接连反抗。在吕雉的脚下，却还有一个被禁锢的帝王。汉惠帝刘盈，一个生错了年代的仁君，只有任凭母后在身上缠绕一根又一根的丝线。他的心中，只有一个愿望，那就是做一个平凡人，他不愿再看到自己的生母一次又一次的造孽。从小，他亲眼看见反抗者被制成人彘的惨剧，成人后，还要被迫迎娶自己的亲外甥女。他憎恨命运，憎恨母亲的残暴，却无法为身边的人做任何事，也许他最恨的是自己的优柔寡断。或许是上天的垂怜，使他及早地离开了这纷纷扰扰的红尘，永远闭上了只能见证悲剧的双眼。\n    历史的清音，散发着生与死的呼唤。\n    又是一个千年，这清音，缓缓飘人了华美的囚牢中。\n失落，浪漫悲哀的词宗\n    独上西楼．剪不断的似水情愁。\n    云没孤鸿，泪泣琵琶，回首往事尽哀愁。南唐后主李煜，抚琴奏出了千古一帝的凄凉。他，迷醉在歌舞升平的浪漫中，挥霍着无尽的潇洒风流。这是一个千年难遇的词宗，却又是一个不称职的君主。以一个诗人的浪漫融人残酷的政治，让无辜的南唐随着他一起陨命。我看到，他彷徨的背影淹没在黑暗中，奏响了在孤寂的亭台中触摸悲凉的悼曲。这是历史的错孽，让一个文化天才埋没在帝王家族中。尘埃尽，硝烟散，他的悲哀将伴随着牵记而去。\n    历史的清音，传递着孤与愁的迷茫。\n    翩翩一叶扁舟，载不动许多愁，双肩扛起的，是数不尽的忧。让那一杯酒，喝尽千古曾经的承诺。传递历史的清音，让历史的沧桑在你我心中流淌。",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626ba3f82071103c96486c4e"),
    articleRid: NumberLong("3"),
    title: "   一种思念",
    articleType: NumberInt("10003"),
    tags: [
        "诗歌",
        "七年级",
        "800字"
    ],
    text: "   当一个人静悄悄时\n\n　　一种孤独感油然而生\n\n　　当走在寂寞的小巷里时\n\n　　一种寂寞萌发而生\n\n　　我多么想要抛弃这种纠缠人的思维\n\n　　我多么想要摆脱这种念头\n\n　　可是上帝好像用一把金锁将我的思维永远留在了寂寞中\n\n　　虽不是永世不得翻身\n\n　　可是谁又能受得了寂寞的考验\n\n　　我可以痛苦，可以悲伤\n\n　　但我不能有寂寞\n\n　　因为寂寞代表着你是没有人陪伴，没有人搭理的一只枯草\n\n　　他会因为寂寞而失去生命\n\n　　他会因为寂寞失去信心\n\n　　他会因为寂寞失去尊重\n\n　　这样的感觉\n\n　　让我感到了全身的疲乏 生活的空洞无趣\n\n　　偶然间\n\n　　我看到了一句话\n\n　　“人，是在为自己而活”\n\n　　对啊，何尝不是呢？\n\n　　人生来就是来受罪的\n\n　　如果你猜不透，摸不着生活的规律\n\n　　你当然感到空虚无意\n\n　　呆呆的\n\n　　忽然有了更深的理解\n\n　　其实我并不是孤单的\n\n　　我身体上的零件\n\n　　在跟我一起分担快乐与寂寞\n\n　　原来，只要看得开，想明白了\n\n　　生活就是由你来主宰的\n\n　　为孤独的人们\n\n　　打开一扇窗\n\n　　希望你能走进来",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626ba4122071103c96486c50"),
    articleRid: NumberLong("4"),
    title: "一天",
    articleType: NumberInt("10004"),
    tags: [
        "散文",
        "七年级",
        "400字"
    ],
    text: "今天，是一年一度的中秋节。本来应该开开心心过节的我，却怎么也开心不起来。知道为什么吗？是这样的：>我的爸爸是一位军人，在星期五也就是前两天，他去出差了。下个星期，他要是能回来就不错了。当我得知这个消息时，如晴天打了一个霹雳，泪水夺眶而出。\n\n　　我真想对爸爸说：“爸爸，您怎么能不回家过中秋呢？您中秋不回家是因为工作，我不怪您。可是，我想，您不会忙到连电话也没空打吧？要不是我挂电话给您，我看您到现在还没有往家里挂电话吧﹗”\n\n　　夜幕降临，隔壁的王叔叔一家都聚在一起过团圆节，整个院子里欢声笑语不止。邻居热闹声、餐桌上佳肴的美味，连同浓郁的酒香越墙传进我们房间。这一闹一寂的场面形成了鲜明的对比。我那不争气的泪水流了下来，豆大的泪珠像断了线的珍珠，顺着我的脸流了下来。妈妈把我紧紧搂在怀里，以示安慰，可我哭得更厉害了。妈妈说：“不要哭，爸爸不在家，妈妈陪你过中秋。”\n\n　　八点钟了，月儿又明又圆，照着我们孤坐的娘俩。\n\n　　那月亮时而现出身，时而钻进云里，时而躲到建筑物的身后\n\n　　哎，不知爸爸现在在干什么",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626bb68a2071103c96486e1e"),
    articleRid: NumberLong("5"),
    title: "茶之韵",
    articleType: NumberInt("10004"),
    tags: [
        "散文",
        "九年级",
        "699字"
    ],
    text: "茶，不是普通的茶，而是人生的茶。——题记\n \n　　亲情就像雨后空中的彩虹，绚烂多彩；亲情就像炎炎夏日的阵阵清风，带来阵阵凉爽；亲情就像那一杯浓浓的茶，充盈着爱的魔法。\n \n　　红茶\n \n　　红茶似乎总是扮演着浓重的角色，不错，我所要写的，正是这浓重的一笔。\n \n　　父亲，这个默默无闻的奉献着，才配有这浓重的一笔。伴着日出劳作，随着月光归来。伴着风雪送我上学，随着时间待我归来。他从无怨言，也许父爱就是这样平凡，可平凡之中确夹杂着无上的伟大。\n \n　　花茶\n \n　　花茶似乎在茶中地位中等，平平淡淡，但是在人生之中，却大不相同。\n \n　　母亲，这个朴实的家庭园丁，只有她才配得上这浓淡交加的一笔。平射的唠叨，平日的劝告，平常的叮咛，都刻在了我的脑海中。还有平日的一杯热牛奶，平日的一个青苹果，平日的饭菜。这不只是内心的浓重，还有外在的淡香，这浓重交加淡香，更显其中韵味。\n \n　　清茶\n \n　　清茶似乎是茶中的配角，可是，在生活当中，却好比黄金搭档。\n \n　　兄妹，家庭的主要核心成员，给人生增添了最后的有力一笔。他们的爱不像父爱那样浓重，不像母爱那样浓淡交加，但他们却起着较大的作用。在你失败时，他们鼓励你奋勇前行。在你忧伤时，他们安慰你。在你遇到难题时，他们为你耐心讲解。他们不仅仅是亲人，还是生活中的挚友。\n \n　　父亲，母亲，兄妹，组合在一起，更能显现出茶的韵味。\n \n　　国庆节到了，在此我用我最激动的心情，感激的泪水，浓浓的笔墨，钩写出我对你们由衷的感谢！！！是校园生活的一小小缩影。教室，迎来送往一届届的学生，虽然都是不同的面孔，但它却是一样的关注，俯视着一张张年轻而充满了朝气的脸，以自己的真诚与执着，守护着勤奋的学子，盼望着走出门的，每个人都能成为丰满而甜美的桃李，真的。",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626bb85a2071103c96486e32"),
    articleRid: NumberLong("6"),
    title: "“活在当下”去创新",
    articleType: NumberInt("10002"),
    tags: [
        "议论文",
        "九年级",
        "1021字"
    ],
    text: "也许，你现在正活在幻想中，深深陶醉;也许，你现在正悠闲地听着音乐，玩着游戏，怡然自乐;也许，你现在正和同学夸夸其谈……也许你现在处于一个轻松愉悦的氛围，然而那只是你选择“活在当下”的状态，享受着自己的每一次呼吸。\n \n　　“活在当下”是中国人乐天知命的传统想法。然而，当我们面当死亡，还可以活在当下吗?我们可以选择活在过去和未来，也可选择活在当下。“当下”，是我们其中一种选择。\n \n　　我常常羡慕陶渊明“采菊东篱下，悠然见南山”的惬意;也佩服屈原将抱负和梦想寄托于现下，创出了脍炙人口的《离骚》绝唱;更仰慕武帝将豪迈和大度寄情于当下，赢得了一番太平盛世。活在当下，才会活出完美历代的文人墨客都怀揣一颗恬静、淡泊、寂寞之心。他们淡然，顾隐世退居，他们豁达，他们开朗。生活在自己给自己制造的快乐中，享受着此刻的幽静，他们想要的只不过是生活最基本的安定和平状态而已。\n \n　　然而活在当下，只是一种着眼于现在的生活态度。当你面对每日一成不变的生活时你可否觉得乏味，人生没有一点创新的火花怎能碰撞出精彩的未来?\n \n　　武则天，这个中国史上唯一的女皇帝，她之所以拥有了改变国家的权力，是因为她有改变自己的创新能力。曾经，她不过是一个徒有美貌毫无才学的才人，失宠却让她懂得了“以才侍君者长，以色侍君者短”这个道理，她努力地改变自己，从一个平凡女子变成一位学者，打破了历代君王只为男性的惯例，从一位学者变成一代君王。她成功，因为她有越人的胆识，更因为她有改变自己的决心和敢于创新的精神。\n \n　　现代画家梵高的《星空》是一幅闻名世界的巨作。但是却是他住在精神病院时创作的一幅作品。画面冷色调为底，张狂的星云如同恶魔的双眼，凌乱的线条组成诡异的星空。当时没有一个人理解他的意图，只当他是精神病发作的一时宣泄而已。可是院长却在这幅如今的世界名画前徘徊很久，他说：“这是梵高又一次创作的巅峰。”同样的一幅画为什么会有截然不同的两种态度，不一样的眼光注定会产生不一样的效果。正是院长这种“创新”的眼光才看到了梵高作品的真正价值!\n \n　　我们需要眼睛，因为眼睛能让我们脱离黑暗看到阳光;我们也需要眼光，因为眼光能让我们看到眼睛看不到的东西。人要立足于世，就要用不一样的眼光去创新。\n \n　　当你陶醉在幻想中时，是否想过如何将幻想变为现实;当你沉浸在悠闲的音乐中时，是否思考你也能让那音乐的歌者写上你的名字;当你开心地和同学夸夸其谈时，又是否想到让别人对你的妙语连珠无比佩服?\n \n　　生活需要我们有“活在当下”的洒脱，更需要敢于创新的勇气。",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
