        "721字"
    ],
    text: "余余落辉，我爱一彩最美；涓涓潺水，我掬一片最清；回顾走过的树林，我独恋枫叶最红；回眸成长的足迹-----我不忘毅者无疆的坚强。\n \n　　7岁时，我爱看《西游记》，而孙悟空便是我的信念。纵然可以千变万化，也要忍受五指山下的嘲讽，一压就是五百年，一忍就是风吹雨打，谁能顶天立地，坚强，被一只猴神化得如此悲壮，这便是开始，即便寂寞也精彩，大丈夫能屈能伸，猴哥，就应该这样。\n \n　　10岁时，我迷上《三国演义》，原先只是喜欢打打杀杀，敬佩关羽而怨恨曹操，那一夜，考试失利后难眠的一夜，心头一触，原来曹操才是英雄。这位大将军在宛城丧子折兵后的痛定思痛；这位汉丞相败走华容道时的嘲笑诸葛亮、周瑜；这位魏王在割须弃泡后巧施反间计，连遭挫折到始终不忘统一天下的抱负，不像刘备，被火烧七百里联营，烧回白帝城后一病不起；不像孙权，夺会荆州，守者父兄的基业就面南称帝。曹操把坚强演义到顶峰，“老骥伏枥，志在千里；烈士暮年，壮心不已”，曹公的诗好不令人痛快！\n \n　　那一夜，我醒了，困难打不败，挫折打不倒，我学会了坚强。\n \n　　13岁，我张大了，渐渐孤傲了，但《名人传》却逆转了我，他们都有伟大的成就，而他们也都是磨难造就的人，他们在漫漫黑夜中摸索前进，而坚强是他们心中的航标，即使看不到光明，他们却将坚强表现得淋漓尽致。贝多芬在双目失明后继续创作乐曲，坚强是他音乐的音符；米开朗琪罗在教堂中，即使心不情愿，也全神贯注的雕刻，坚强是他的灵感，直到生命最后仍在坚持。我心中孤傲的火焰慢慢熄灭，化作一泓平静泉水。\n \n　　今年我15岁了，回眸成长之间，我懂了一句话“天将降大任于是人也，必先苦其心志，劳其筋骨，饿其体肤，空乏其身，行拂乱其所为”，既然上天已降大任于你我，那么，就让我们带者坚强出发吧！去奋斗，去拼搏，去履行生命的诺言！",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626bb9362071103c96486e38"),
    articleRid: NumberLong("8"),
    title: "《等待戈多》读后感",
    articleType: NumberInt("10004"),
    tags: [
        "散文",
        "九年级",
        "1417字"
    ],
    text: "13日出生在爱尔兰都柏林的一个新教家庭里，1923年进入都柏林的三一学院学习法文和意大利文，1927年毕业。第二年贝克特被选派到巴黎高等师范学校担任为期两年地英语助教，结识了已经是意识流小说大师的同乡乔伊斯，并且与人合作把他的一些作品译成了法文。\n \n　　任教期满，贝克特回到三一学院任拉丁语讲师，1932年辞职后专事创作，同时先后在法国、爱尔兰、英国和德国漫游，在1937年看到纳粹主义的威胁后返回巴黎定居。他在二战期间参加了抵抗运动，替一个为英国收集情报的支部翻译资料和打字。结果支部被人出卖，他躲过了盖世太保的追捕，逃到普罗旺斯的一个村庄里当雇工。和平刚刚恢复，他又志愿到诺曼底的一个红十字会医院去当了几个月的翻译。\n \n　　等待戈多写的是发生在两个黄昏的事情，但没有什么情节可言。主人公是两个流浪汉，背景是一片荒野，路旁只有一棵枯树，两个流浪汉就在树下等待一个名叫戈多的人。他们一面做着闻臭靴子之类的无聊动作，一面在语无伦次的梦呓。最后有一个男孩来说戈多今晚不来了，第一幕就算结束。第二幕是第一幕的重复，只是当知道戈多又不来的时侯，他们就想上吊，结果裤带一拉就断，于是只能毫无希望的等待下去。\n \n　　等待戈多显然是一出荒诞剧，这种情景可以发生在任何时代，任何地方，因为戈多是谁，谁也不知道，它表现的只是人类等待的希望只能化为泡影的悲惨现实。这里的等待，在法语里是现在进行时，所以它不是本义上的期待，而是一种生存状态，意味着人类永远再等待，却又不知道到底再等待什么，而且永远不可能等来什么。正因为这个剧本用荒诞的手段极其深刻地揭示了生活的荒诞和无意义，它才流传至今吧，并且成为法兰西喜剧院的保留剧目，并且被译成20多种语言。\n \n　　等待戈多这部剧本反映了时代的悲剧，表现了大战在西方人心灵下留下的创伤，以及他们在冷战中对社会现实的绝望。\n \n　　这种用完全荒诞的手法来表现世界和人生的荒诞，在形式和内容上达到了完美的统一，因而能引起我们内心的震撼，像希腊悲剧那样起到了净化心灵的作用。\n \n　　没有什么事发生，没有人来，没有人去，真可怕。\n \n　　怀着一颗好奇的心，我读完了这本爱尔兰作家贝克特的这本曾获诺贝尔文学奖的《等待戈多》，闭上眼，脑中一片混乱。整个剧情用上面那句话来概括再恰当不过，就是这样一部看似重复和无聊之极的戏剧，却是贝克特荒诞派戏剧的经典之作。\n \n　　贝克特通过他的方式向人们呈现人们自己亲身经历着的生活状态本身，只是将它荒诞化了，他将这荒诞的感觉拉长了也缩短了，他把它捏扁打碎复又粘贴起来，让我们看清楚它到底是个什么样子。\n \n　　弗拉基米尔和埃斯特拉冈，在一棵不知名的大树下，两个老人呆呆的坐着，偶尔传来毫无意义的对白，却仍是等待着，没有思绪的等待，知道天黑离去，口中还念念不忘，明天，戈多会来的。\n \n　　戈多是谁呢？有人说戈多指的是上帝，有人说戈多代表着希望，也有人说戈多是你梦想却得不到的东西。不论戈多是什么，戈多真的会来么？两个老流浪汉只要一直等就可以了么？\n \n　　戏剧结尾的时候\n \n　　埃斯特拉冈说：“嗯，咱们走不走？”\n \n　　弗拉基米尔说：“好，咱们走吧。”\n \n　　他们坐着不动。\n \n　　我清楚的记得，戏剧中，他们有好几次说他们要走了，但他们仍然坐着不动。等待戈多，永远只有等待，等来的是一个奴隶主和他的奴隶，等来的是戈多说明天再来的通知。其实他们都知道也许明天戈多也不会来，也许他们根本就不是在等待戈多，而是在等待中消磨他们所剩无多的生命。就好像我们重复着日复一日的工作，单调着日复一日的生活，如同《等待戈多》中的两个流浪汉一样披着等待的外衣逃避着什么。",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626bb9752071103c96486e3c"),
    articleRid: NumberLong("9"),
    title: "《角斗士的月亮》",
    articleType: NumberInt("10004"),
    tags: [
        "散文",
        "九年级",
        "870字"
    ],
    text: "从来就那么宽广的天空，却被罗马皇帝割下一块盖在了斗兽场，斗兽场成了个圆笼，锁住了我，同样锁住了我的思想。\n \n　　月亮如同神一般无私，将同样纯净的月光毫不犹豫地撒在了斗兽场这个罪恶的地方，也洒在了我的肩膀上，凄冷的斗兽场变的凄美，而肩膀上的月光让我发狂。\n \n　　我用力扒着铁窗，发狂的思想把我带到了很远的家乡，那是最美的地方，我的老母亲很慈祥，我的孩子很可爱，我的妻子也很漂亮。社会的没落让我们贫穷，但我天生有强壮的身体，这使我们衣食无忧；我们同样很善良，圣父，圣子教诲我们“爱上帝，爱他人如同爱自己”。神灵赐与我一切美好又让我们懂得忍受和谦让。\n \n　　可贫穷让圣父圣子的信徒向风刮过的地方，有风，就有我们的力量！强大的力量威胁到了古罗马帝王，这些作威作福的贵族害怕了我们的力量，于是利用犹大把圣子耶稣钉死在十字架上。\n \n　　月光让愤怒的我如此发狂。\n \n　　为什么？究竟为什么？！圣子真的有罪吗？贫穷而善良的我们有罪吗？而罗马皇帝就没罪吗？为何要制定法规排斥唾骂我们？\n \n　　仁慈的主啊！您在什么的地方？您赐与我永恒的力量，却为何让我眼睁睁让卫兵的矛刺击穿我妻子的腹腔？却又为何不让同样的矛刺进我同样愤怒的腹腔？而把我锁在了斗兽场！\n \n　　明天，我将穿上厚厚的牛皮甲去同我的同伴或那些饥饿的野兽厮杀，供那些贵族们玩赏。。。。。\n \n　　月亮，您能否告诉我，我的妻子是否已在天堂；告诉我，我的母亲和孩子是否已躲在一个安全的地方，用希冀的眼神注视着您——月亮。\n \n　　爱，让我不再发狂。\n \n　　可怜的贵族们，我强壮的身体不可供你们玩赏。我纯洁善良的思想无法让我拿起武器劈向我同伴的肌肤。但我可爱的同伴，你尽管将我劈碎，我要用金属砍断肌肉里血管的声音和溅飞得鲜血为我可爱的同伴和斗兽场洗去罪孽。可爱的同伴，你尽可提着我裂开的身体去赢得贵族们赏赐——逃离斗兽场这个苦难的地方。\n \n　　皎洁而可爱的月光，托您转告我的妻子不要孤单，我很快就去陪她；告诉我的老母亲，我坚定了自己的信仰，将飞往幸福的天堂；再告诉我的孩子，坚定自己的信仰，“爱上帝，爱他人如同爱自己”。可怜那些不分善恶正如不分黑白的人们，因为，他们很快就会像罗马斗兽场那样\n \n　　——灭亡。",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626bb99b2071103c96486e3e"),
    articleRid: NumberLong("10"),
    title: "《理智与情感》读后感",
    articleType: NumberInt("10004"),
    tags: [
        "散文",
        "九年级",
        "674字"
    ],
    text: "简·奥斯汀以反讽刺的手法写了她的第一部小说《理智与情感》，但写作技巧相当熟练。故事中的每一个情节，人物个性描述的都非常真实细腻，让人由衷地感叹简·奥斯汀对人性的洞察。情节围绕着两位女主人公的择偶活动展开，揭露当时英国资本主义社会，以婚配作为女子寻求经济保障、提高经济地位的一种风俗，重门第而不顾儿女感情和做人权利的丑陋时尚。如同书名展现的那样，整个故事集中表现了“理智”与“情感”的矛盾冲突。\n \n　　玛丽安是理智不足而感情有余；约翰·达什伍德夫妇是理智有余而感情不足；而威洛比是感情上十分虚伪，表面上似乎很有情感，实际上却冷漠无情，自私透顶。简·奥斯汀在故事里对珍重感情的人物加以赞扬，尽管对哪些人在理智上的欠缺也不时加以讽刺；然而对缺少感情仅有理智或是在感情上虚伪的人，却表现出极度鄙视的态度。简·奥斯汀最赞赏的是埃莉诺，因为她即重感情又有理智。这里也阐述了简·奥斯汀在这个问题上的看法，即不能没有感情，也不能过于理智。故事的女主角均追求与男士思想感情的平等交流与沟通，要求社会地位上的平等权利，坚持选择伴侣的自由。这在当时的英国，应该是一种叛逆的行为。\n \n　　理智与情感好比一把双刃剑，坚持理智，可能会伤了情感，照顾情感，可能又失去理智。能很理智地处理情感，能在情感的一定范围内保持理智，当然最好，这是运用这把双刃剑的最好方式。但是，现实生活中，往往会面临着取舍时，你是理智多于情感呢？还是情感多于理智？或是像威洛比先生哪样，表面上很有情感内心却很自私自利。所以，愿我们每一个人都能驾御自己的理智与情感，而不是被它所奴役。",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);
db.getCollection("article").insert([ {
    _id: ObjectId("626bb9d32071103c96486e40"),
    articleRid: NumberLong("11"),
    title: "爸爸的脚印",
    articleType: NumberInt("10001"),
    tags: [
        "记叙文",
        "九年级",
        "686字"
    ],
    text: "耐不住故乡久违了的思念，终于在一场淅沥的小雨中踏上征途。\n \n　　到了村口，我下了车。闭上眼，仔细嗅着这早已属于记忆的家的芳香。\n \n　　雨中的村庄，虽然看来是那样的安详，美丽，但是，脚下泥泞的小路却会为行人留下难以忘却的印象。因为，由泥土组成的路，原本就是坑坑洼洼，有沟有壑，一不小心就会有被石头绊倒的可能，再加上下雨，小路更是雪上加霜。\n \n　　我眺望着这条水土凝集的小路，它似乎是那样的长，那样的泥泞。\n \n　　我犹豫着，如果真的置身于这泥土中，漂亮的鞋子就会完全变了模样。\n \n　　正当我犹犹豫豫不敢向前时，却突然发现前方一方亮亮的突出的泥土。“脚印！”我欣喜的大叫。我找到了希望。\n \n　　我踩着这一个个脚印走着，我猛的想起了脚印，爸爸的脚印。\n \n　　每一个人都希望自己能够战胜别人，成为焦点，我同样也是。那年的期末考试，我成绩平平，还是没有超过一直在县里名列前茅的表姐，在亲人都大加赞赏，羡慕乃至是嫉妒的目光中，我低着头，逃离了现场。\n \n　　我不能够容忍自己永远的落在一个无人问津的角落，更不能看着鲜花和掌声一次次为别人鸣响，盛开。“但是事实，不可改变！”我想。\n \n　　不知何时，爸爸看到了在门口呆立的我。“走，上西山玩去！”我服从命令一样的跟在爸爸身后。也是刚下过雨，崎岖的通向西山的路全被雨水打湿。我走着，走着，差点被石头绊倒。“爸，不去了，太难走。”我苦着脸说道。“孩子，路都是人走出来的，无论它是多么的崎岖，多么的艰苦，人生不可能总是一路阳光。你要像脚印一样踏踏实实地一直走下去，一直……来，踩着我的脚印走”\n \n　　现在，我遥望着自己踏过的脚印，就像一路明晃晃的风铃，一个又一个。\n \n　　启动记忆的年轮，是一个个坚实的爸爸的脚印，一个个尘封已久的故事。",
    _class: "com.yizhi.common.model.pojo.mongodb.Article"
} ]);

