    tags: [
        "敬业"
    ],
    text: "人生之目的，为尽义务而来。每人必有一定职务，必做一番事业，此谓之职业……今之人误解职业，以得权利为惟一目的，实则不然。重在义务，不仅有益自身，且须有益于人群，始不辜负此人生。（蔡元培）",
