    text: "诚信是一朵兰花，它开在人们荒芜的心田；诚信，是一杯浓茶，它让生活更加浓郁芳醇；诚信是一道劲歌，它奏响了时代的最强音；诚信是中华民族的传统美德，为人处事的最基本准则。",
