    materialType: NumberInt("20003"),
    tags: [
        "诚信"
    ],
    text: "诚信是一粒种子，沐着春风，喝着秋雨，它一点点地长大。几度风雨，几度磨练，它就是希望，它是生命的源泉。聪明人有了它，事业有成，一帆风顺；()愚笨者遇到它，抛弃自卑，勇往直前。成功者有了它，信心百倍，攻入新关；失败者遇到它，重整旗鼓，东山再起。它是兴奋  剂，是金钥匙，给不同的人以不同的效力，让他们学会正视自己，热爱生活。",
